import { countBy } from './countBy';
import { pipe } from './pipe';
describe('data first', function () {
    test('countBy', function () {
        expect(countBy([1, 2, 3, 4, 5], function (x) { return x % 2 === 0; })).toEqual(2);
    });
    test('countBy.indexed', function () {
        expect(countBy.indexed([1, 2, 3, 4, 5], function (x) { return x % 2 === 0; })).toEqual(2);
    });
});
describe('data last', function () {
    test('countBy', function () {
        expect(pipe([1, 2, 3, 4, 5], countBy(function (x) { return x % 2 === 0; }))).toEqual(2);
    });
    test('countBy.indexed', function () {
        expect(pipe([1, 2, 3, 4, 5], countBy.indexed(function (x) { return x % 2 === 0; }))).toEqual(2);
    });
});
